FeedPackage.ReleaseNotes:
1. Added support of Sass version 3.2.15;
2. IronRuby was updated to commit 6e767994da;
3. Fixed bug #69 "Page does not load, IISExpress cpu usage climbs";
4. Slightly increased performance.

1. Ruby Sass was replaced by libSass;
2. Now this module requires assemblies `msvcp120.dll` and `msvcr120.dll` from the Visual C++ Redistributable Packages for Visual Studio 2013;
3. From configuration settings removed two properties - `TraceSelectors` and `DebugInfo`;
4. In configuration settings `LineNumbers` property has been renamed to `SourceComments`;
5. In configuration settings was added 4 new properties: `IndentType` (default `Space`), `IndentWidth` (default `2`), `LineFeedType` (default `CrLf`) and `Precision` (default `5`);
6. Due to the transition to libSass has been significantly increased performance of this module;
7. Now this module supports the string interpolation in file paths;
8. This module does not resolve paths of the client components (images, fonts and CSS files).

1. Ruby Sass was replaced by libSass;
2. Now this module requires assemblies `msvcp120.dll` and `msvcr120.dll` from the Visual C++ Redistributable Packages for Visual Studio 2013;
3. From configuration settings removed two properties - `TraceSelectors` and `DebugInfo`;
4. In configuration settings `LineNumbers` property has been renamed to `SourceComments`;
5. In configuration settings was added 4 new properties: `IndentType` (default `Space`), `IndentWidth` (default `2`), `LineFeedType` (default `CrLf`) and `Precision` (default `5`);
6. Due to the transition to libSass has been significantly increased performance of this module;
7. Now this module supports the string interpolation in file paths;
8. This module does not resolve paths of the client components (images, fonts and CSS files).

1. Added support of libSass version 3.3.3;
2. Fixed a bug “Sass compilation sometimes fails with native exception in 32 bit mode”;
3. Fixed a bug, that occurred when processing relative paths, which are located at higher level, than the current directory.

1. Added support of the LibSass Host for .NET version 1.0.0 Beta 1;
2. Native assemblies for Windows have been moved to separate packages: LibSassHost.Native.win-x86 and LibSassHost.Native.win-x64;
3. Now the libSass for Windows requires `msvcp140.dll` assembly from the Visual C++ Redistributable for Visual Studio 2015.

1. Added support of the LibSass Host for .NET version 1.0.0;
2. Native assemblies for Windows have been moved to separate packages: LibSassHost.Native.win-x86 and LibSassHost.Native.win-x64;
3. Now the libSass for Windows requires `msvcp140.dll` assembly from the Visual C++ Redistributable for Visual Studio 2015.

1. Added support of TypeScript version 1.8.7;
2. No longer made preprocessing of `reference` comments;
3. In configuration settings of TypeScript-translator was added 5 new properties: `AllowUnreachableCode` (default `false`), `AllowUnusedLabels` (default `false`), `ForceConsistentCasingInFileNames` (default `false`), `NoFallthroughCasesInSwitch` (default `false`) and `NoImplicitReturns` (default `false`).

1. JavaScript Engine Switcher was updated to version 2.0.0;
2. Added support of TypeScript version 2.0 RC;
3. In configuration settings of TypeScript-translator was added one new property: `NoErrorTruncation` (default `false`).

1. Added support of UglifyJS version 2.6.3;
2. From mangling settings was removed `Sort` property;
3. In compression settings was added one new property - `Passes` (default `1`);
4. In code generation settings was added one new property - `KeepQuotedProperties` (default `false`).

1. Added support of UglifyJS version 2.7.4;
2. In compression settings was added one new property - `NegateIife` (default `true`);
3. In code generation settings was added one new property - `WrapIife` (default `false`), and changed a default value of `Comments` property from empty string to `some`.

1. Added support of UglifyJS version 2.8.29;
2. In code generation settings was changed a default value of `InlineScript` property from `false` to `true`;
3. In compression settings was changed a default value of `CollapseVars` property from `false` to `true`;
4. In compression settings was added 7 new properties: `KeepInfinity` (default `false`), `ReduceVars` (default `true`), `TopLevel` (default `false`), `TopRetain` (default empty string), `UnsafeMath` (default `false`), `UnsafeProto` (default `false`) and `UnsafeRegExp` (default `false`).
